@import url('https://fonts.googleapis.com/css2?family=Nanum+Gothic&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Maven+Pro&display=swap');

$background-color : #2f2f2f;
$primary-color : #32c1c4;
$second-color : #26c984;

body {

  * {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    list-style: none;
    text-decoration: none;
    color: #2f2f2f;
    font-family: 'Nanum Gothic', 'Maven Pro', sans-serif;
  }

  img {
    width: 200px;
  }

  h1 {
    font-size: 7rem;
    font-weight: 800;
    color: $primary-color;
  }

  h2 {
    font-size: 4rem;
    font-weight: 800;
    line-height: 4.2rem;
    color: $primary-color;
  }

  h3 {
    font-size: 3rem;
    font-weight: 800;
    color: $primary-color;
  }

  h4 {
    font-size: 2rem;
    font-weight: 800;
    line-height: 2.5rem;
  }

  h5 {
    font-size: 1.5rem;
    font-weight: 600;
  }

  h6 {
    font-size: 1.2rem;
    font-weight: 600;
    line-height: 1.5rem;
  }

  p {
    font-size: 1rem;
    font-weight: 600;
    line-height: 1.5rem;
  }

  i {
    color: $primary-color;
    margin-right: 1rem;
    font-size: 1.5rem;
  }

  .container {
    width: 1200px;
    margin: 0 auto;
  }

  .btn-primary {
    background-color: transparent;
    color: transparent;
    border: none;

    span {
      position: relative;
      z-index: 2;
      user-select: none;
      padding: 10px;
      transition: color 1s ease;
      -webkit-transition: color 1s ease;
      -moz-transition: color 1s ease;
      -o-transition: color 1s ease;
      -ms-transition: color 1s ease;
      font-weight: 600;
      color: #fff;
      border-bottom: 3px solid #fff;
      margin-bottom: 15px !important;
      font-size: 16px !important;
      display: inline-block !important;

      &:focus,
      &:hover {
        outline: 0;
        color: $primary-color;
        -webkit-transition: color 1s ease;
        -moz-transition: color 1s ease;
        -o-transition: color 1s ease;
        -ms-transition: color 1s ease;
        transition: color 1s ease;
        cursor: pointer;
      }

      &:after,
      &:before {
        -webkit-transition: all 1s ease 0s;
        -moz-transition: all 1s ease 0s;
        -o-transition: all 1s ease 0s;
        -ms-transition: all 1s ease 0s;
        transition: all 1s ease 0s;
      }

      &:focus:after,
      &:focus:before,
      &:hover:after,
      &:hover:before {
        outline: 0;
        background-color: $primary-color;
        -webkit-transition: all 1s ease 0s;
        -moz-transition: all 1s ease 0s;
        -o-transition: all 1s ease 0s;
        -ms-transition: all 1s ease 0s;
        transition: all 1s ease 0s;
      }

      &:before {
        position: absolute;
        z-index: -1;
        width: 3px;
        height: 100%;
        left: 0;
        content: "";
        top: 0
      }

      &:focus:before,
      &:hover:before {
        width: 100%;
        height: 100%;
      }

      &:hover {
        color: #fff !important;
      }
    }
  }

  // MAIN
  main {
