        display: flex;
        flex-direction: column;
        align-items: flex-start;
        text-align: left;

        ul {
          &:nth-child(1) {
            margin-bottom: 3rem;
          }

          li:nth-child(1) {
            margin-bottom: 2rem;
            color: $background-color;
            font-weight: 800;
          }
        }
      }
    }

    .overlay.open {
      opacity: 1;
      visibility: visible;
      height: 100%;
      z-index: 50;

      li {
        animation: fadeInRight 0.5s ease forwards;
        animation-delay: 0.35s;

        &:nth-of-type(2) {
          animation-delay: 0.4s;
        }

        &:nth-of-type(3) {
          animation-delay: 0.45s;
        }

        &:nth-of-type(4) {
          animation-delay: 0.5s;
        }

        &:nth-of-type(5) {
          animation-delay: 0.55s;
        }

        &:nth-of-type(6) {
          animation-delay: 0.6s;
        }
      }
    }

    .overlay nav {
      position: relative;
      height: 70%;
      top: 50%;
      transform: translateY(-50%);
      font-size: 50px;
      font-weight: 400;
      text-align: center;

      ul {
        list-style: none;
        padding: 0;
        margin: 0 auto;
        display: inline-block;
        position: relative;

        li {
          display: block;
          position: relative;
          opacity: 0;
          font-size: 3rem;
          margin-bottom: 1rem;

          a {
            display: block;
            position: relative;
            color: #FFF;
            text-decoration: none;
            font-size: 2rem;
            font-weight: 600;
            padding-bottom: 0.5rem;
          }

          a:hover:after,
          .overlay ul li a:focus:after,
          .overlay ul li a:active:after {
            width: 80%;
          }

          a:after {
            content: "";
            position: absolute;
            bottom: 0;
            left: 40%;
            width: 0%;
            transform: translateX(-50%);
            height: 3px;
            background: #FFF;
            transition: 0.5s;
          }
        }
      }
    }

    @keyframes fadeInRight {
      0% {
        opacity: 0;
        left: 20%;
      }

      100% {
        opacity: 1;
        left: 0;
      }
    }
  }

